import React, { Component } from 'react';
import Header from "./header";
import Sidebar from "./sidebar";
import Content from "./content";

export default class Root extends Component{
    render() {
        return(
            <div>
                <div>
                <Header />
                <Sidebar />
                <Content />
                </div>
                <div>
                    {this.props.children}
                </div>
            </div>
        )
    }

}
